import React, { Component } from 'react';
import logo from './Asset_10.svg';
import styled from 'styled-components'


const Sty = styled.div`
background-color: #f8bc00;
font-family: 'Athiti', sans-serif;
`

class App extends Component {
  render() {
    return (
      <div>
        <Sty></Sty>
      </div>
    );
  }
}
export default App
